import Head from "next/head";
// import Layout from "../components/layouts";

const Noop = ({ children }) => children;

export default function JustSell({ Component, pageProps }) {
  const Layout = Component.Layout || Noop;
  return (
    <>
      <Head>
        <title>JustSell</title>
      </Head>
      <MainLayout>
        <Layout>
          <Component {...pageProps} />
        </Layout>
      </MainLayout>
    </>
  );
}
